import React, { useState } from 'react'

function AppointmentDetail({message, isOpen, onClose}) {

  const [message2, setMessage2] = useState('Hello')

  if (!isOpen){
    return null
  }
  return (
    <div>
      {/* {message} */}
      {message2}
      <button onClick={()=>{setMessage2('UwU')}}>
        Close me!
      </button>
    </div>
  )
}

export default AppointmentDetail
